async function () {
  let hardwareChanges = HardwareConfigForm.formData;
  let softwareChanges = SoftwareConfigForm.formData;
  let licenseChanges = LicenseConfigForm.formData;
  console.log(hardwareChanges);
  let configData = appsmith.store.currentConfigState;
  let selectedPositionIndex = appsmith.store.currentPositionIndex;
  let currentPositionConfig = configData.authorizeMatrix[selectedPositionIndex];
  let currentHardwareConfig = currentPositionConfig.Hardware;
  let currentSoftwareConfig = currentPositionConfig.Software;
  let currentLicenseConfig = currentPositionConfig.License;
  configData.authorizeMatrix[selectedPositionIndex].Hardware = _.merge(currentHardwareConfig, hardwareChanges);
  configData.authorizeMatrix[selectedPositionIndex].Softwrae = _.merge(currentSoftwareConfig, softwareChanges);
  configData.authorizeMatrix[selectedPositionIndex].License = _.merge(currentLicenseConfig, licenseChanges);
  await storeValue("currentConfigState", configData, true);
}
